def findAnagrams(s, p):

    ans = []
    pcc = [0] * 26
    for i in p:
        pcc[ord(i)-ord("a")] += 1

    for start in range((len(s)-len(p))+1):
        icc = [0] * 26
        for i in s[start:start+len(p)]: icc[ord(i)-ord("a")] += 1
        if pcc == icc:
            ans.append(start)
    return ans


if __name__ == '__main__':
    s = ""
    p = ""
    print(findAnagrams(s, p))

